import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Navbar, Button } from 'react-bootstrap';

const mapStateToProps = (state) => {
  return { counter: state.counter };
};
const mapDispatchToProps = (dispatch) => {
  return {
    dupaWolowa: () => dispatch({ type: 'INCREMENT' }),
    onDecrement: () => dispatch({ type: 'DECREMENT' })
  }
};

class Navigation extends Component {
	render() {
		const { counter, onDecrement, dupaWolowa } = this.props;

		return ( <>
			<Navbar bg="light">
				<Button className="mr-2" variant="outline-dark" onClick={ dupaWolowa } ><b> Zapisz </b></Button>
				<Button className="mr-4" variant="outline-dark" onClick={ dupaWolowa } ><b> Wczytaj </b></Button>
			</Navbar>
		</> );
	}
}

export default Navigation = connect(mapStateToProps, mapDispatchToProps)(Navigation);
